@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://youtube.com/"), url-prefix("http://www.youtube.com/watch"), url-prefix("http://www.youtube.com/results"), url("http://www.youtube.com/"), url-prefix("http://www.youtube.com/videos"), url-prefix("http://www.youtube.com/my"), url-prefix("http://www.youtube.com/video_response_upload"), url-prefix("http://www.youtube.com/inbox"), url-prefix("http://www.youtube.com/education"), url-prefix("http://www.youtube.com/comedy"), url-prefix("http://www.youtube.com/gaming"), url-prefix("http://www.youtube.com/music"), url-prefix("http://www.youtube.com/news"), url-prefix("http://www.youtube.com/sports"), url-prefix("http://www.youtube.com/show"), url-prefix("http://www.youtube.com/movie"), url-prefix("http://www.youtube.com/trailers"), url-prefix("http://www.youtube.com/contests"), url-prefix("http://www.youtube.com/events"), url-prefix("http://upload.youtube.com/"), url-prefix("http://www.youtube.com/user/")
{

