    background: black !important;
}

#watch-related, .watch-expander-head, #watch-channel-discoverbox, .yt-uix-expander-head, #watch-next-list-actions, .fm-title-underlined-gray, #statmodules_inbox-title, .yt-uix-button-menu-item, .category-selected, .subcategory, .main-tabs-spotlight-inner, .hot-trends-cloud-area, .yt-menubutton-menu li a, #mymedia #list-pane .folder.selected, .yt-menulink-menu li a, .yt-menulink-menu span a, .search-setting-inner, .watch-stats-title tr[style] td, .watch-stats-title-cell, .yt-suggest-unselected, #feed_promoted-content, #feed_subscriptions-content, #REC-data, #FEA-data, #POP-data, #feedmodule-FRI, .statModule-item-line, #statmodules_inbox-content, #GEO-data, #TOP-data, .browse-tab-modifiers, #movie-promo, .watch-module-body, .pyv-single, .side-announcement-box, #feedmodule-INM, #feedmodule-INC, .watch-module-body, #upload-interface, .upload-outer-box, #instructions, #playnav-channel-header, #playnav-play-all-scrollbox, .inner-box-colors, .inner-box, #watch-flag-menu a, #watch-flag-menu a:visited, .yt-uix-button-menu, .inner-box-bg-color, input[type="button"]
{
    background: #111111 !important;
}

.watch-ppv-vid, .video-list-item-link:hover, .video-list-item-link:hover, #watch-comments-core .current, #watch-comments-core .current .wrapper, .promoted-videos, #search-duplicates-message, #fyf_container, .yt-uix-button-menu-item:hover, .browse-categories-side, #browse-video-channels-modifiers, .main-tabs-spotlight-inner .video-entry, .hot-trends-cloud-inner-area, .yt-menubutton-menu li a:hover, #mymedia #list-pane .subfolder.selected, .yt-menulink-menu li a:hover, .yt-menulink-menu span a:hover, .yt-suggest-selected .yt-suggest-left, .yt-suggest-selected .yt-suggest-right, .yt-suggest-selected .grayText, .yt-suggest-close, .gray-tab-box-header, .groupnamecont.selected, #movie-promo-body, .watch-pyv-vid, #starting-box, .upload-inner-box, .outer-box-bg-color, textarea, input[type="button"]:hover
{
    background: #222222 !important;
}

.next-list-current, #playnav-navbar a.navbar-tab-selected, #playnav-navbar a.navbar-tab:hover
{
    background: #333333 !important;
}

body, #watch-headline-title, .watch-expander-head, .yt-uix-pager .yt-uix-button, .video-list-item .stat, .video-description, .show-description, .episode-description, .channel-description, .movie-description, .show-long-description, .show-short-description, .show-mini-description, .video-facets, .channel-facets, .playlist-facets, .playlist-main-stats, .movie-facets, .trailer-facets, .show-facets, .mini-list-view .video-view-count, .mini-list-view .rental-price, .mini-list-view .video-username, #search-duplicates-message, .video-stat span, .feedmodule-subnull-txt, .homepage-whats-new-content, textarea, .grayText, .groupnamecont, .message td, .metadata, .inner-box-colors, .inner-box, input[type="button"]
{
    color: #cccccc !important;
}

a, .video-list-item .title, .yt-uix-pager .yt-uix-pager-selected, .yt-uix-expander-head, .yt-uix-button, .watch-comments-post, .comment-highlight-section-header, #watch-headline-title, .video-description b, .show-description b, .episode-description b, .channel-description b, .movie-description b, .show-long-description b, .show-short-description b, .show-mini-description b, #search-section-header .name, #search-related-terms .search-related-title, .yt-uix-button-menu-item, .video-stat, #no-videos, ul.pickers, #no-playlists, .browse-modifiers-extended .selected, .video-list-item .stat strong, input, .fm-title-underlined-blue, .feedmodule-subnull-txt-header, .iyt-edit-link, .groupnamecont.selected, .shmoovies-list-container #recent-column h4, .shows-table .extra, .homepage-block-heading, #chrome-promo-hp .tagline, #watch-category span, #watch-tags span, .title-text-color, #playnav-curvideo-title, input[type="button"]
{
    color: white !important;
}

.yt-uix-button, .watch-comments-post, #mymedia #table #headings td, .yt-menubutton .yt-menubutton-btn, .yt-menubutton .yt-menubutton-arr, .yt-button, .fm-title-underlined-blue, .fm-title-underlined-gray, #statmodules_inbox-title, .sorterbar th, #masthead-container, #page, .watch-module-head, .homepage-block-heading, input[type="button"]
{
    background: black !important;
/*
    background: -moz-linear-gradient(center top , #333333, #000000) repeat scroll 0 0 #000000 !important;
    background: -webkit-gradient(linear, left top, left bottom, from(#333333), to(#000000)) !important;
*/
}

.yt-uix-button:hover, .yt-button:hover, input[type="button"],
.video-translation-links a
{
     background: #333333 !important;
}

#watch-info, .yt-button, .yt-menubutton-menu, .browse-tab-modifiers, .main-tabs-spotlight-inner, .browse-categories-side, .hot-trends-cloud-area, [class="watch-module-body"]
{
    border: 1px #333333 solid !important;
}

[class="watch-module-body"]
{
    padding: 5px !important;
}

.video-list-item .title
{
    width: 163px !important;
}

.watch-expander-body, #watch-stats-container
{
    max-height: 300px !important;
    overflow-y: auto !important;
}

.watch-module-body
{
    max-height: 600px !important;
    overflow-y: auto !important;
}

.comment-highlight-section-header, .watch-next-list-actions
{
    border-top: 1px #333333 solid !important
}

.time
{
    visibility: visible !important;
}

.ad-div,
div#watch-branded-actions,
#yt-uix-tooltip-tip1,
#watch-share
{
    display: none !important;
}

#feed_subscriptions-content, #REC-data, #FEA-data, #POP-data, .fm-title-underlined-gray, .statModule-item-line, #statmodules_inbox-title, .fm-title-underlined-blue, #feed_promoted-content, #GEO-data, #TOP-data, .pyv-single .metadata, .pyv-label-home, .homepage-block-heading, .homepage-whatsnew-entry, .homepage-whats-new-content .alignR
{
    padding-left: 10px !important;
    padding-right: 10px !important;
}

.yt-menubutton .yt-menubutton-btn, .yt-menubutton .yt-menubutton-arr, .yt-uix-button, #watch-channel-discoverbox, .watch-expander-head, #watch-actions-area, #content.watch-wide #watch-sidebar .watch-active-list .watch-module-head, #content.watch-wide #watch-sidebar .watch-active-list .watch-module-body, .search-setting-inner, #watch-sidebar .watch-module-expandable .watch-module-head, .watch-module-body, #page #masthead-container, .outer-box-bg-as-border, #upload-interface, .upload-outer-box, #baseDiv #side-column, input[type="button"]
{
    border-color: #444444 !important;
}

.yt-menubutton .yt-menubutton-arr img, .yt-menubutton .yt-menubutton-arr button, .sorterbar th
{
    border-left: 0px !important;
}

.iyt-edit-link
{
    border-bottom: 0px !important;
}

#watch-info, #page #masthead-container
{
    border: 0px !important;
}

.fm-title-underlined-blue, .fm-title-underlined-gray, #statmodules_inbox-title, #feedmodule-FRI, .homepage-block-heading, .homepage-whats-new-content
{
    -moz-border-radius-topleft: 10px !important;
    -moz-border-radius-topright: 10px !important;
    -webkit-border-top-left-radius: 10px !important;
    -webkit-border-top-right-radius: 10px !important;
}

textarea
{
    -moz-border-radius: 5px !important;
}

#watch-branded-image-map img[src="http://s.ytimg.com/yt/img/pixel-vfl73.gif"]
{
    background-image: none !important;
}

img.master-sprite, .master-sprite img, .yt-uix-expander-arrow, #logo
{
    background-image: url(data:image/png;base64,) !important;
}
}
